import React, { Component } from "react";

class Register extends Component {
  constructor() {
    super();

    this.state = {
      page: 1,
      country: ["South Afica"]
    };
  }

  setGender(event) {
    console.log(event.target.value);
  }

  renderPage() {
    if (this.state.page == 1) {
      return (
        <div>
          <h1>Aplicant information </h1>
         <div className="field">
          <label> Name </label>
          <input class="input" type="text" placeholder="Enter name" />
        </div>
          <div className="field">
            <label> Surname </label>
            <input class="input" type="text" placeholder="Enter Surname" />
          </div>
          <div className="field">
            <label> Email </label>
            <input class="input" type="text" placeholder="Enter Email" />
          </div>
          <div className="field">
            <label> contact </label>
            <input class="input" type="text"  placeholder="Enter Contacts"/>
          </div>
          <div className="field">
            <label> date of birth </label>
            <input type="text" class="input" placeholder="date of birth" />
            </div>
            <div onChange={this.setGender.bind(this)}>

            <label style={{display:"block" , margin:"1rem"}}> Gender </label>
            <input type="radio" value="MALE" name="gender"/> Male
            <input type="radio" value="FEMALE" name="gender"/> Female
          </div>
        </div>
      );
    }
    if (this.state.page == 2) {
      return (
        <div>
          <div className="field">
            <label> city </label>
            <input type="text" />
            </div>
            <select class="option">
              <option>Country </option>
            </select>
            <div className="field">
            <label> place of birth </label>
            <input type="text" />
            </div>
        </div>
      );
    }
  }

  changePage() {
    const name = "mo";
    this.setState({ page: this.state.page + 1 });
  }

  render() {
    return (
      <div class="register">
        {this.renderPage()}
        <button className="btn" onClick={() => this.changePage()}> next </button>
      </div>
    );
  }
}

Register.propTypes = {};

export default Register;
